import React, { useEffect } from "react";
import "./App.css";
import uniqid from "uniqid";

function App() {
  const [data, setData] = React.useState({ characters: [] });
  const randomNumberArray = () =>
    Array(10).fill(Math.floor(Math.random() * 150));

  useEffect(() => {
    fetch("https://api.jikan.moe/v4/anime/38000/characters")
      .then((response) => response.json())
      .then((data) =>
        data.data.map((x) => {
          return setData((prevState) => ({
            characters: [
              ...prevState.characters,
              {
                name: x.character.name,
                img_url: x.character.images.jpg.image_url,
                id: uniqid(),
                clicked: false,
              },
            ],
          }));
        })
      )
      .catch((err) => console.error(err));
  }, []);

  return (
    <div>
      <h1>{data.characters[0].name}</h1>
      {console.log(randomNumberArray)}
      <img src={data.characters[0].img_url} height="500" alt="zenitsu"></img>
    </div>
  );
}

export default App;
